pub enum FramedTransportError<E, U: Encoder + Decoder> {
    Service(E),
    Encoder(<U as Encoder>::Error),
    Decoder(<U as Decoder>::Error),
}

pub enum InOrderError<E> {

    /// Service error
    Service(E),

    /// Service call dropped
    Disconnected,
}

pub enum TimeoutError<E> {

    /// Service error
    Service(E),

    /// Service call timeout
    Timeout,
}
